package sdetjavabatchclass2;

public class RelationOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int number1=10;
		int number2=20;
		System.out.println(number1==number2); //check if both variable contain same thing
		
		System.out.println("***************");
		
		boolean results=number1==number2;
		System.out.println(results);
		
		System.out.println("******************");
		
		int number3=10;
		int number4=5;
		
		System.out.println(number3>number4);
		System.out.println(number3<number4);
		System.out.println(number3>=number4);
		System.out.println(number3<=number4);
		System.out.println(number3!=number4);
		
		
		
		System.out.println("*******************");
		
		

	}

}
